import React, { Component } from "react";

export default class Count extends Component {
    constructor() {
      super();
      this.state = {
        count: 0
      };
    }

    incrementCount = () => {
      this.setState({
        count: this.state.count + 1
      });
    };

    decrementCount = () => {
      this.setState({
        count: this.state.count - 1
      });
    };

    render() {
      let { count } = this.state;
      return (
        <div className="app">
          <div>

            <div className="buttons">
                <button onClick={this.decrementCount}>-</button>
                <h1>{count}</h1>
                <button className onClick={this.incrementCount}>-</button>
            </div>
          </div>
        </div>
      );
    }
  }
